	(7, 'คอนโดพระราม 3', 'ถนน พระราม 3 ซอย 73, อาคารทิพยประกันภัย / จอดง่ายสะดวก มียามคอยดูแล มีที่จอดเพียงพอไม่ต้องแย่งพื้นที่ใดๆ ที่จอดรถบริเวณ ชั้น B1', 0, 20, 13.7022, 100.541, _binary , 'Josabuy', '097-007-5209', NULL, '2018-04-17 15:03:04'),
